Matt, here is some Mylar code that 'intercepts' the content assist list, and 
adds items to the beginning of that list (so that your highest-interest java 
elements are at the top of the list).  Note that it does the hideous thing of 
accessing a private field, but that's the only reasonable way of going from a 
proposal to an IJavaElement.

This processor just uses the standard JDT IContentAssistant.  You could 
install your own assistant if the error is happening earlier than this.  You 
probably know this but content assistants are installed by providing your own 
source configuration on your subtype of CompilationUnitEditor, e.g.:

    protected void initializeEditor() {
        super.initializeEditor();
        setSourceViewerConfiguration(new MylarJavaSourceViewerConfiguration(
                JavaPlugin.getDefault().getJavaTextTools().getColorManager(), 
                getPreferenceStore(), this, 
IJavaPartitions.JAVA_PARTITIONING));
    }

public class MylarJavaCompletionProcessor extends JavaCompletionProcessor {

    public MylarJavaCompletionProcessor(IEditorPart editor) {
        super(editor); 
    }

    @MylarWebRef(name="Reflection documentation", 
url="http://www.onjava.com/pub/a/onjava/2003/11/12/reflection.html?page=last")
    public ICompletionProposal[] computeCompletionProposals(ITextViewer 
viewer, int offset) {    
        try {
            ICompletionProposal[] proposals = super.computeCompletionProposals
(viewer, offset);

            TreeMap<Float, ICompletionProposal> interesting = new 
TreeMap<Float, ICompletionProposal>();
            List<ICompletionProposal> rest = new ArrayList<ICompletionProposal>
();
            for (int i = 0; i < proposals.length; i++) {
                ICompletionProposal proposal = proposals[i];
                JavaCompletionProposal javaProposal = (JavaCompletionProposal)
proposal;
                ProposalInfo info = javaProposal.getProposalInfo();

                // HACK
                try {
                    if (info != null) {
                        IMember member = null; 
                        if (info instanceof MemberProposalInfo) {
                          Class infoClass = info.getClass();
                          Method method = infoClass.getDeclaredMethod
("resolveMember", new Class[] { } );
                          method.setAccessible(true);
                          member = (IMember)method.invoke(info, new Object[] 
{ });
                        }
                        if (member == null) {
                            rest.add(proposal);
                        } else {
                            float interest = MylarPlugin.getTaskscapeManager
().getDoi(member.getHandleIdentifier()).getDegreeOfInterest().getValue();
                            if (!(member instanceof IType) 
                                 && interest > MylarPlugin.getTaskscapeManager
().getActiveTaskscape().getScalingFactors().getInteresting()) {
                                interesting.put(-interest, proposal);  // 
negative to invert sorting order
                            } else {
                                rest.add(proposal);
                            } 
                        }
                    }
                } catch (Exception e) {
    //                System.err.println(e);
                    e.printStackTrace();
                } 
            }
            ICompletionProposal[] sorted = new ICompletionProposal
[interesting.keySet().size() + rest.size() + 1];
            int i = 0;
            for (Float f : interesting.keySet()) {
                sorted[i] = interesting.get(f);
                i++; 
            }    
            if (interesting.keySet().size() > 0) {
                sorted[i] = new JavaCompletionProposal("", 
((JavaCompletionProposal)sorted[i-1]).getReplacementOffset(), 0, null, "-------
---------", 0);
                i++;
            } 
            for (ICompletionProposal proposal : rest) {
                sorted[i] = proposal;
                i++;
            }
            return sorted;
        } catch (Exception e) {
            e.printStackTrace();
        }
        return null;
    } 
}
